import { NavLink } from "react-router-dom";
import "./navbar.css";
import { Button } from "..";

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <NavLink className="navbar-logo" to="/">
          Junebug
        </NavLink>
        <div className="navbar-btn">
          <Button name="SIGN IN">
          </Button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
